// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract PresaleContract is Ownable, ReentrancyGuard {
    IERC20 public token;
    uint256 public tokenPrice;
    uint256 public tokensSold;
    uint256 public maxTokensToSell;
    bool public isPresaleActive;

    mapping(address => uint256) public balances;
    mapping(address => bool) public allowedERC20Tokens;

    event TokensPurchased(address indexed buyer, uint256 amount, address paymentToken);
    event PresaleEnded(uint256 tokensSold, uint256 etherCollected);

    constructor(
        address _tokenAddress,
        uint256 _tokenPrice,
        uint256 _maxTokensToSell
    ) {
        require(_tokenAddress != address(0), "Invalid token address");
        require(_tokenPrice > 0, "Token price must be greater than zero");

        token = IERC20(_tokenAddress);
        tokenPrice = _tokenPrice;
        maxTokensToSell = _maxTokensToSell;
        isPresaleActive = true;
    }

    function addAllowedERC20Token(address _tokenAddress) external onlyOwner {
        require(_tokenAddress != address(0), "Invalid token address");
        allowedERC20Tokens[_tokenAddress] = true;
    }

    function removeAllowedERC20Token(address _tokenAddress) external onlyOwner {
        allowedERC20Tokens[_tokenAddress] = false;
    }


    function purchaseTokens(uint256 _amount) external payable nonReentrant {
        require(isPresaleActive, "Presale is not active");
        require(_amount > 0, "Amount must be greater than zero");
        require(tokensSold + _amount <= maxTokensToSell, "Not enough tokens left for sale");

        uint256 totalCost = _amount * tokenPrice;

        if (allowedERC20Tokens[msg.sender]) {
            require(IERC20(msg.sender).transferFrom(msg.sender, address(this), totalCost), "Token transfer failed");
        } else {
            require(msg.value == totalCost, "Incorrect Ether amount sent");
        }

        balances[msg.sender] += _amount;
        tokensSold += _amount;

        emit TokensPurchased(msg.sender, _amount, allowedERC20Tokens[msg.sender] ? msg.sender : address(0));
    }


    function withdrawUnsoldTokens() external onlyOwner nonReentrant {
        require(!isPresaleActive, "Presale is still active");
        uint256 unsoldTokens = maxTokensToSell - tokensSold;
        require(unsoldTokens > 0, "No unsold tokens");

        token.transfer(owner(), unsoldTokens);
    }

    function endPresale() external onlyOwner nonReentrant {
        require(isPresaleActive, "Presale is not active");
        isPresaleActive = false;

        // Transfer all the Ether to the owner
        uint256 contractBalance = address(this).balance;
        if (contractBalance > 0) {
            payable(owner()).transfer(contractBalance);
        }

        emit PresaleEnded(tokensSold, contractBalance);
    }

    function withdrawTokens() external {
        require(!isPresaleActive, "Presale is still active");
        uint256 tokenAmount = balances[msg.sender];
        require(tokenAmount > 0, "No tokens to withdraw");

        balances[msg.sender] = 0;
        token.transfer(msg.sender, tokenAmount);
    }
}

